B.Vs=new A.eJ("Avalia\xe7\xe3o do Ciclo de Vida:","Conceito","A ACV \xe9 considerada uma ferramenta completa e valiosa de apoio aos tomadores de decis\xe3o tanto para a forma\xe7\xe3o de pol\xedticas quanto para a ind\xfastria na avalia\xe7\xe3o dos impactos durante todo o ciclo de vida do produto em quest\xe3o, incluindo a extra\xe7\xe3o de mat\xe9rias-primas; o processamento e fabrica\xe7\xe3o do produto; o transporte ou distribui\xe7\xe3o do produto ao consumidor; o uso do produto pelo consumidor; e o descarte ou recupera\xe7\xe3o do produto ap\xf3s sua vida \xfatil.",null)
B.Vt=new A.eJ("Normas de desempenho t\xe9rmico:","INI - C","\xc9 uma Instru\xe7\xe3o Normativa Inmetro que especifica os crit\xe9rios e os m\xe9todos para a classifica\xe7\xe3o de edifica\xe7\xf5es comerciais, de servi\xe7os e p\xfablicas quanto \xe0 sua efici\xeancia energ\xe9tica, visando \xe0 etiquetagem de edifica\xe7\xf5es. A classifica\xe7\xe3o pode ser geral ou parcial. Na INI-C a classifica\xe7\xe3o \xe9 realizada com base no consumo de energia prim\xe1ria  e a estimativa do consumo de energia pode ser realizada por meio dos m\xe9todos simplificado e de simula\xe7\xe3o. O m\xe9todo simplificado avalia as edifica\xe7\xf5es atrav\xe9s de crit\xe9rios, equa\xe7\xf5es e tabelas.\n\nFonte: Refer\xeancia da norma",null)
B.Vu=new A.eJ("Normas de desempenho t\xe9rmico:","ASHRAE 90-1","Norma americana que estabelece requisitos m\xednimos de efici\xeancia  energ\xe9tica em edifica\xe7\xf5es envolvendo todas as atividades n\xe3o industriais, exceto as residenciais  unifamiliares. Apresenta tr\xeas m\xe9todos de avalia\xe7\xe3o: m\xe9todo prescritivo, simula\xe7\xe3o e m\xe9todo  de compensa\xe7\xf5es. Para a envolt\xf3ria da edifica\xe7\xe3o, o m\xe9todo prescritivo indica limites m\xe1ximos ou m\xednimos de transmit\xe2ncia t\xe9rmica e resist\xeancia  t\xe9rmica de isolamentos, al\xe9m do fator solar de vidros de acordo com a \xe1rea de janela na fachada  e orienta\xe7\xe3o solar.\n\nFonte: Inserir a fonte",null)
B.Vv=new A.eJ("Propriedades t\xe9rmicas","Transmit\xe2ncia t\xe9rmica","\xc9 a transmiss\xe3o de calor em unidade de tempo, atrav\xe9s de uma \xe1rea unit\xe1ria de um elemento ou componente construtivo. \n\nUnidade= W/m\xb2.K\n\nS\xedmbolo = U",null)
B.Vw=new A.eJ("Avalia\xe7\xe3o do Ciclo de Vida:","Fases da ACV","Etapa 1 - Objetivo e escopo: identifica o prop\xf3sito da ACV e os produtos esperados do estudo. \xc9 quando s\xe3o determinados os limites (o que est\xe1 e o que n\xe3o est\xe1 incluso no estudo) e outras premissas.\n\nEtapa 2 - An\xe1lise de Invent\xe1rio: quando s\xe3o quantificados os insumos de energia e mat\xe9ria-prima e as emiss\xf5es ambientais associadas a cada etapa do ciclo de vida do sistema avaliado.\n\nEtapa 3 - Avalia\xe7\xe3o de impacto: quando ocorre uma avalia\xe7\xe3o dos impactos na sa\xfade humana e no meio ambiente associados aos insumos energ\xe9ticos e de mat\xe9ria prima e \xe0s emiss\xf5es ambientais quantificadas pelo invent\xe1rio.\n\nEtapa 4 - Interpreta\xe7\xe3o: quando s\xe3o avaliadas oportunidades para reduzir energia, insumos materiais ou impactos ambientais em cada est\xe1gio do ciclo de vida do produto.",null)
B.Vx=new A.eJ("Propriedades t\xe9rmicas","Capacidade t\xe9rmica","Quantidade de calor necess\xe1ria para variar em uma unidade a temperatura de um sistema. Nos componentes \xe9 o quociente da capacidade t\xe9rmica de um componente pela sua \xe1rea. \n\nUnidade= kJ/(m2.K).\n\nS\xedmbolo= CT",null)
