B.Vz=new A.eJ("Avalia\xe7\xe3o do Ciclo de Vida:","Categorias de impacto","Potencial de Aquecimento Global (GWP) - kgCO2 eq - Descreve mudan\xe7as nas temperaturas superficiais locais, regionais ou globais causadas por um aumento da concentra\xe7\xe3o de gases de efeito estufa na atmosfera. Tamb\xe9m conhecida como \u201cpegada de carbono\u201d. Gases comuns incluem CO2, N2O, CH4 e compostos org\xe2nicos vol\xe1teis (VOCs).\xb7 Potencial para Acidifica\xe7\xe3o (AP) - kgSO2 eq - A acidifica\xe7\xe3o \xe9 uma consequ\xeancia de \xe1cidos (e outros compostos que podem ser transformados em \xe1cidos) sendo emitidos para a atmosfera e posteriormente depositados em solos superficiais e na \xe1gua. O aumento da acidez pode resultar em consequ\xeancias negativas para a flora e para a fauna, al\xe9m de aumento da corros\xe3o de estruturas feitas pelo homem (edif\xedcios, ve\xedculos, etc.).\xb7 \nPotencial para Eutrofiza\xe7\xe3o (EP) - kgPO4 eq - Descreve o efeito da adi\xe7\xe3o de nutrientes minerais ao solo ou \xe0 \xe1gua, o que faz com que certas esp\xe9cies dominem um ecossistema, comprometendo a sobreviv\xeancia de outras esp\xe9cies e, por vezes, resultando na morte de popula\xe7\xf5es animais inteiras. \nPotencial para a Cria\xe7\xe3o de Oz\xf4nio Fotoqu\xedmico (POCP) \u2013 kg etileno eq - Descreve o efeito de subst\xe2ncias na atmosfera para criar polui\xe7\xe3o fotoqu\xedmica. O POCP, comumente conhecido como SMOG, \xe9 t\xf3xico para os seres humanos em alta concentra\xe7\xe3o. O crescimento das plantas tamb\xe9m \xe9 afetado.\n Potencial de Deple\xe7\xe3o da Camada de Oz\xf4nio (ODP) - kgCFC11eq - est\xe1 relacionado \xe0 diminui\xe7\xe3o da camada de oz\xf4nio pela emiss\xe3o de poluentes, os clorofluorocarbonetos, por isso \xe9 considerado um impacto global; gerando aumento da radia\xe7\xe3o ultravioleta UV-B, n\xfamero de casos de doen\xe7as de pele, al\xe9m de afetar os ecossistemas\xb7 \nDeple\xe7\xe3o de Recursos - combust\xedveis f\xf3sseis (ADPF) \u2013 MJ eq.- A ADPF \xe9 uma medida da extra\xe7\xe3o e consumo de fontes de energia n\xe3o renov\xe1veis, principalmente combust\xedveis f\xf3sseis, mas tamb\xe9m de outras fontes de energia, como o ur\xe2nio. \xb7                   Deple\xe7\xe3o de Recursos n\xe3o f\xf3sseis (ADP nF) - kg antim\xf4nio eq. - Corresponde ao impacto ambiental de um produto ou processo em rela\xe7\xe3o ao esgotamento de recursos naturais n\xe3o f\xf3sseis. Este indicador quantifica a diminui\xe7\xe3o da disponibilidade de recursos minerais e met\xe1licos n\xe3o renov\xe1veis ao longo do ciclo de vida do produto. \nDemanda de energia acumulada (CED) - MJ equivalente-  \xe9 um indicador utilizado para avaliar o desempenho energ\xe9tico dos edif\xedcios. A demanda de energia prim\xe1ria de um produto representa os fatores diretos e indiretos ao longo do ciclo de vida, incluindo a energia consumida durante a extra\xe7\xe3o, fabrica\xe7\xe3o e descarte das mat\xe9rias. Possui seis categorias: n\xe3o renov\xe1vel, f\xf3sseis; n\xe3o renov\xe1vel, nuclear; n\xe3o renov\xe1vel, biomassa; renov\xe1vel, biomassa; renov\xe1vel, e\xf3lica, solar ou geot\xe9rmica; e renov\xe1vel, \xe1gua.",null)
B.VA=new A.eJ("Normas de desempenho t\xe9rmico:","NBR 15220","Norma brasileira que apresenta recomenda\xe7\xf5es quanto ao desempenho t\xe9rmico de habita\xe7\xf5es unifamiliares de interesse social aplic\xe1veis na fase de projeto. Ela est\xe1 dividida em cinco partes: a parte 1 possui as defini\xe7\xf5es, s\xedmbolos e unidades. A parte 2 apresenta os m\xe9todos de c\xe1lculo de algumas propriedades t\xe9rmicas. A parte 3 apresenta o zoneamento bioclim\xe1tico brasileiro e diretrizes construtivas para habita\xe7\xf5es unifamiliares de interesse social. A parte 4 fala sobre medi\xe7\xe3o da resist\xeancia t\xe9rmica e da condutividade t\xe9rmica pelo princ\xedpio da placa quente protegida. Por fim, a parte 5 trata da medi\xe7\xe3o da resist\xeancia t\xe9rmica e da condutividade t\xe9rmica pelo m\xe9todo fluxim\xe9trico.\n\nFonte: ABNT NBR 15220-3: Desempenho t\xe9rmico de edifica\xe7\xf5es \u2013 Parte 3: Zoneamento bioclim\xe1tico brasileiro e diretrizes construtivas para habita\xe7\xf5es unifamiliares de interesse social. Rio de Janeiro (2005)",null)
B.VB=new A.eJ("Normas de desempenho t\xe9rmico:","INI - R","\xc9 uma Instru\xe7\xe3o Normativa Inmetro que especifica  os crit\xe9rios e os m\xe9todos para classifica\xe7\xe3o de edifica\xe7\xf5es residenciais quanto \xe0 sua efici\xeancia energ\xe9tica, visando \xe0 etiquetagem de edifica\xe7\xf5es. As edifica\xe7\xf5es submetidas a esta INI-R devem atender \xe0s normas da Associa\xe7\xe3o Brasileira de Normas T\xe9cnicas (ABNT) vigentes e aplic\xe1veis. Para as edifica\xe7\xf5es residenciais, a estimativa do consumo de energia pode ser realizada por meio dos m\xe9todos prescritivo, simplificado e de simula\xe7\xe3o. No m\xe9todo prescritivo, a classifica\xe7\xe3o da envolt\xf3ria \xe9 obtida por meio da compara\xe7\xe3o de caracter\xedsticas geom\xe9tricas dos APPs e de propriedades t\xe9rmicas dos sistemas construtivos, em rela\xe7\xe3o aos valores de refer\xeancia destes par\xe2metros, determinados no procedimento simplificado da ABNT NBR 15575:2021. \n\nFonte: INI-R. Instru\xe7\xe3o Normativa do Inmetro para Classifica\xe7\xe3o de Efici\xeancia Energ\xe9tica de Edif\xedcios Residenciais (INI-R) (2022). Dispon\xedvel em: https://pbeedifica.com.br/inir. Accessed in: Jan. 2023.",null)
