B.VD=new A.eJ("Normas de desempenho t\xe9rmico:","NBR 15575","Norma brasileira de avalia\xe7\xe3o de desempenho da edifica\xe7\xe3o para auxiliar no atendimento de requisitos, que se referem aos sistemas que comp\xf5em as edifica\xe7\xf5es  habitacionais. Estabelece tr\xeas procedimentos distintos para avalia\xe7\xe3o da adequa\xe7\xe3o do  desempenho t\xe9rmico de edifica\xe7\xf5es habitacionais:  simplificado,  medi\xe7\xe3o (informativo) e a simula\xe7\xe3o computacional. O m\xe9todo simplificado \xe9 avaliado pelo atendimento aos requisitos e crit\xe9rios para os  sistemas de veda\xe7\xe3o e de coberturas e possibilita alcan\xe7ar apenas n\xedvel m\xednimo de desempenho  t\xe9rmico. Caso resulte em um desempenho insatisfat\xf3rio, dever\xe1 ser avaliado pela simula\xe7\xe3o computacional.\n\nFonte: ABNT NBR 15575: 2021 Edif\xedcios habitacionais - Desempenho. Rio de Janeiro, 2021.",null)
